package common

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_MAV_ODID_OPERATOR_LOCATION_TYPE(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e MAV_ODID_OPERATOR_LOCATION_TYPE
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := MAV_ODID_OPERATOR_LOCATION_TYPE_TAKEOFF.MarshalText()
		require.NoError(t, err)

		var dec MAV_ODID_OPERATOR_LOCATION_TYPE
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, MAV_ODID_OPERATOR_LOCATION_TYPE_TAKEOFF, dec)
	})
}
